import favoriteData from "./favoriteData"

export default function Favorite() {
    const favoriteElements = favoriteData.map(favorite => {
        return (
            <div className="favorite-container">
                <img src={favorite.image} alt="favorite product" />
                <h2 className="favorite-title">{favorite.title}</h2>
                <p className="favorite-description">{favorite.description}</p>
            </div>
        )
    })
    return (
        <div></div>
    )
}
